import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 700px;
  background: #ffffff;
  h3 {
    font-weight: 600;
    font-size: 32px;
    line-height: 48px;
    text-align: center;
    color: #000000;
  }
  p {
    font-size: 20px;
    line-height: 30px;
    text-align: center;
    color: #000000;
  }
`;
